<template>
  <div class="count" style="display: flex">
    <button @click="handleEraser">擦除</button>
    <button @click="save">保留</button>
    <canvas ref="main" style="border: 1px solid #000"></canvas>
    <canvas ref="copy" style="border: 1px solid #000"></canvas>
  </div>
</template>

<script>
// import Vue 不是必须的，需要手动指定 Vue 的版本时，可以解开注释
// import Vue from 'vue';

export default {
  data() {
    return {
      target: `data:image/png;base64,`,
      origin: `data:image/jpeg;base64,`,
    };
  },
  methods: {
    addCount() {
      this.count += 1;
    },
    handleEraser() {
      this.copyCanvas.freeDrawingBrush = new fabric.EraserBrush(this.copyCanvas)
      this.copyCanvas.freeDrawingBrush.width = 20
      // this.copyCanvas.inverted = true
    },
    save() {
      this.copyCanvas.freeDrawingBrush = new fabric.PatternBrush(this.copyCanvas);

      this.copyCanvas.freeDrawingBrush.getPatternSrc =   () => {
        var patternCanvas = fabric.document.createElement("canvas");
        patternCanvas.width = patternCanvas.height = 900 ;
        var ctx = patternCanvas.getContext("2d");
        let img = new Image();
        img.src = this.origin;
        img.onload =  () => {
          ctx.drawImage(
              img,
              (this.copyCanvas.width - 450) / 2,
              (this.copyCanvas.height - 800) / 2,
              450,
              800
          );
        };

        return patternCanvas;
      };
      this.copyCanvas.freeDrawingBrush.width = 20;
      this.copyCanvas.freeDrawingBrush.source =
          this.copyCanvas.freeDrawingBrush.getPatternSrc.call(this);
    }
  },
  mounted() {
    let mainCanvas = this.mainCanvas = new fabric.Canvas(this.$refs.main, {
      width: 900,
      height: 900,
      controlsAboveOverlay: true,
      enableRetinaScaling: true,
      selection: false,
    });

    let copyCanvas = this.copyCanvas = new fabric.Canvas(this.$refs.copy, {
      width: 900,
      height: 900,
      controlsAboveOverlay: true,
      enableRetinaScaling: true,
      selection: false,
      selectable: false,
    });
    // mainCanvas.isDrawingMode = true;
    // mainCanvas.freeDrawingBrush = new fabric.PencilBrush(mainCanvas);
    // mainCanvas.freeDrawingBrush.width = 20;
    // mainCanvas.freeDrawingBrush.color = "rgba(0,0,0,0.5)";
    // mainCanvas.freeDrawingBrush.globalCompositeOperation = "source-atop";
    let that = this;
    this.pointers = []

    mainCanvas
      .on("mouse:down", function (options) {
        isDrawing = true;
        that.pointers.push(new fabric.Point(options.pointer.x, options.pointer.y))
        this.isDrawingMode =true
          onMouseDown(options);
      })
      .on("mouse:up", function (options) {
        isDrawing = false;
        this.isDrawingMode = false
        onMouseUp(options);
      })
      .on("mouse:move", function (options) {
        if (this.isDrawingMode) {
          that.pointers.push(new fabric.Point(options.pointer.x, options.pointer.y))

          let path = this.freeDrawingBrush.convertPointsToSVGPath(that.pointers)

          let finalPath = this.freeDrawingBrush.createPath(path)
          finalPath.set({
            stroke: 'rgba(40,0,255,.51)',
            strokeWidth: 10,
            selectable: false,
            hoverCursor: 'default',
            globalCompositeOperation: 'source-over'
          })
          console.log(this)
          this.add(finalPath)
          this.renderAll()
        }
        if (isDrawing) {
          const pointer = mainCanvas.getPointer(options.e);
            drawRealTime(options, pointer);
        }
      });

    mainCanvas.on("mouse:wheel",  (opt) => {
      var delta = opt.e.deltaY;
      var zoom = mainCanvas.getZoom();
      zoom *= 0.999 ** delta;
      if (zoom > 20) zoom = 20;
      if (zoom < 0.01) zoom = 0.01;
      mainCanvas.zoomToPoint({ x: opt.e.offsetX, y: opt.e.offsetY }, zoom);
      copyCanvas.zoomToPoint({ x: opt.e.offsetX, y: opt.e.offsetY }, zoom);
      opt.e.preventDefault();
      opt.e.stopPropagation();
      // console.log(900 / zoom)

    });

    this.createImg = function () {

      new fabric.Image.fromURL(this.target, o => {
        let img = new Image(this.target)
        img.src = this.target
        img.onload = () => {
          let c = fabric.document.createElement('canvas')
          c.width = o.width
          c.height=o.height
          console.log(o.width, '00')
          let ctx = c.getContext('2d')
          ctx.drawImage(img, 0,0, o.width, o.height)
          let imageData = ctx.getImageData(0,0, o.width, o.height)
          // 遍历像素数据
          for (var i = 0; i < imageData.data.length; i += 4) {
            // 判断像素是否不透明
            if (imageData.data[i + 3] !== 0) {
              // 将不透明部分的颜色值改为红色，保持透明度为0.5
              imageData.data[i] = 255;   // 红色
              imageData.data[i + 1] = 0; // 绿色
              imageData.data[i + 2] = 0; // 蓝色
              imageData.data[i + 3] = 128; // 透明度（0.5 * 255）
            }
          }
          ctx.putImageData(imageData, 0, 0);
          let base = c.toDataURL('image/png');
          new fabric.Image.fromURL(base, oImg => {
            oImg.set({
              id: 'img',
              selectable: false,
              hoverCursor: "default",
            });
            mainCanvas.add(oImg);
            mainCanvas.centerObject(oImg);
            mainCanvas.renderAll();
          })
          // 导出修改后的图片
          // var downloadLink = document.createElement('a');
          // downloadLink.href = c.toDataURL('image/png');
          // downloadLink.download = 'modified_image.png';
          // downloadLink.click()
        }
      })
    }


    let isDrawing = false;
    this.createImg()
    new fabric.Image.fromURL(this.target, (oImg) => {
      oImg.set({
        width: 450,
        height: 800,
        id: 'img',
        selectable: false,
        hoverCursor: "default",
      });
      copyCanvas.add(oImg);
      copyCanvas.centerObject(oImg);
      copyCanvas.renderAll();

      mainCanvas.add(oImg);
      mainCanvas.centerObject(oImg);
      mainCanvas.renderAll();
    });
    copyCanvas.skipTargetFind = true; //整个画板元素不能被选中
    copyCanvas.freeDrawingBrush = new fabric.PatternBrush(copyCanvas);
    copyCanvas.freeDrawingBrush.getPatternSrc = function () {
      var patternCanvas = fabric.document.createElement("canvas");
      patternCanvas.width = patternCanvas.height = 900 ;
      var ctx = patternCanvas.getContext("2d");
      let img = new Image();
      img.src = this.origin;
      img.onload = function () {
        ctx.drawImage(
          img,
          (copyCanvas.width - 450) / 2,
          (copyCanvas.height - 800) / 2,
          450,
          800
        );
      };

      return patternCanvas;
    };

    copyCanvas.freeDrawingBrush.width = 20;
    copyCanvas.freeDrawingBrush.source =
      copyCanvas.freeDrawingBrush.getPatternSrc.call(this);

    function onMouseDown(options) {
      const pointer = mainCanvas.getPointer(options.e);
      copyCanvas.freeDrawingBrush.onMouseDown(pointer, options);
    }

    function onMouseUp(options) {
      const pointer = mainCanvas.getPointer(options.e);
      copyCanvas.freeDrawingBrush.onMouseUp(options);
    }

    function drawRealTime(options, pointer) {
      copyCanvas.freeDrawingBrush.onMouseMove(pointer, options);
    }
  },
};
</script>

<style>
.count {
  color: red;
}
</style>
